import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import FrontPage from './FrontPage';
import Login from './Login';


const App = () => {
  return (
    <Router>
      <div>
        <Route exact path="/" component={FrontPage} />
        <Route path="/user" component={Login} />
        <Route path="/tourismAgent" component={Login} />
        <Route path="/airlineAgent" component={Login} />
        <Route path="/flightAttendant" component={Login} />
        <Route path="/systemAdmin" component={Login} />
      </div>
    </Router>
  );
};

export default App;
